Declare @Anaheim int; 
select @Anaheim = swj.StormwaterJurisdictionID from StormwaterJurisdiction swj inner join Organization o on swj.OrganizationID = o.OrganizationID where o.OrganizationName like '%Anaheim%';

Insert into dbo.OnlandVisualTrashAssessmentArea ( OnlandVisualTrashAssessmentAreaName, StormwaterJurisdictionID, OnlandVisualTrashAssessmentAreaGeometry)
